import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import './App.css';
import HomePage from './pages/HomePage';
import LabDashboard from './pages/LabDashboard';
import ComputerList from './components/ComputerList';
import Breadcrumb from './components/Breadcrumb';

// Mock data for labs
const LABS = [
  { id: 'lab-a', name: 'Computer Lab A', totalComputers: 25 },
  { id: 'lab-b', name: 'Computer Lab B', totalComputers: 30 },
  { id: 'lab-c', name: 'Computer Lab C', totalComputers: 20 },
];

// Main App component
function App() {
  return (
    <div className="app">
      <Breadcrumb />
      <Routes>
        <Route path="/" element={<HomePage labs={LABS} />} />
        <Route path="/lab/:labId" element={<LabDashboard labs={LABS} />}>
          <Route index element={<Navigate to="working" replace />} />
          <Route path="working" element={
            <ComputerList status="working" title="Working Computers" />
          } />
          <Route path="non-working" element={
            <ComputerList status="non-working" title="Non-Working Computers" />
          } />
        </Route>
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </div>
  );
}

// Wrapper component to provide router context
const AppWrapper = () => {
  return (
    <Router>
      <App />
    </Router>
  );
};

export default AppWrapper;
